import React from "react";
import styled from "styled-components";

const SearchButton = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    padding: 10 20;
    background-color: blue;
`;

const Button = () => {
    return <SearchButton>해당지역 재검색</SearchButton>;
};

export default Button;
